export const Header = () => {
  let stylingObject = {
    div: {
      color: 'gold',
      border: '1px solid black',
      height: '100px',
      textAlign: 'center',
      paddingTop: '50px',
    },
  }
  return (
    <div style={stylingObject.div}>
      <h1>Welcom to Application</h1>
    </div>
  )
}
